import React from 'react';
import { AppBar } from '@material-ui/core';

import styles from './Cards.module.css';

const NavBar = () => {
    return (
        <AppBar color="primary" position="static">
          <h1>My header</h1>
        </AppBar>
    )
}

export default NavBar;
